.home {
  .logo {
    border: 5px solid white;
    color: white;
    background:#0e4f91;
    height: 80px;
    width: 100px;
    display: flex;
    font-size: 2rem;
    text-align: center;
    padding: 22px;
    font-weight: bold;
    justify-content: center;
    align-items: center;
  }
  .info-section{
    padding: 54px;
    width: 35%;
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    .info-box{
      bottom: 60px;
      position: absolute;
      h4{
        font-size: 1.2rem;
        color: white;
        margin: 0.7rem 0; //0.7rem (top and bottom) 0(left and right)
      }
      p{
        font-size: 0.9rem;
        font-weight: 300;
        color: white;
        margin: 0.2rem 0 1.6rem; //(top - sides - bottom)
      }
    }
  }

  //image and right-side content
  .content-area {
    margin-left: 40%;
    width: 60%;
    background: white;
    height: 100%;
    //padding: 0 0 0 25%; //(left side padding)

    .img-container{
      display: inline-block;
      width: 30%;
      position: relative;
      height: 100%;

      .user-img{
        position: absolute;
        top: 56px;
        left: -200px;
        width: 400px;
        height: calc(100% - 112px);
        background: url("https://i.postimg.cc/G3JkHfPR/Parker-8728.jpg") no-repeat center center;  //https://css-tricks.com/perfect-full-page-background-image/
        -webkit-background-size: cover;
        -moz-background-size: cover;
        -o-background-size: cover;
        background-size: cover;
        -webkit-box-shadow: 9px 27px 44px -11px rgba(0,0,0,0.54);
        -moz-box-shadow: 9px 27px 44px -11px rgba(0,0,0,0.54);
        box-shadow: 9px 27px 44px -11px rgba(0,0,0,0.54);
        }
      }

  .profile-section{
    display: inline-block;
    vertical-align: top;
    padding: 20% 10% 0 0;
    max-width: 500px;

    .profile {
      h1{
        font-size: 2.3rem;
        font-weight: 800px;
        line-height: 1.2;
        margin: 0 0 1.7rem;
        }

      span {
        color:#0e4f91;
        font-weight: bold;
        font-size: 3rem;
        }

      h5 {
        font-size: 1.1rem;
        margin: 0 0 2rem;
        }

      p {
        color: grey;
        font-weight: 300;
        line-height: 1.2;
        margin: 0 0 2rem;
        }
      }
    }
  }
  .icon-section{
    a {
      color: white;
      text-decoration: none;
      font-size: 1.5rem;
      padding: 0 10px;
      &:hover {
        color: orange;
      }
      //shift the icons to align with Find Me On
      //The :first-child selector is used to select the specified selector, only if it is the first child of its parent.
      &:first-child{
        padding: 0 10px 0 0;
      }
    }
  }
}


//Responsive code
// Small devices (landscape phones, 765px and up)
@media (max-width: 767px) {
    .home {
      width: 100%;
      background-color: white;

      .content-area{
        margin-left: 0;
        width: 100%;

          .img-container{
            padding: 40% 2% 0 0;
            height: 90%;
              .user-img{
                position:static;
                justify-content: center;
                align-items: center;
                background-size: 100%;
              }
            }
            .profile-section{
              left: 25;
              display: inline-block;
              vertical-align: top;
              background-color: white;
              text-align: center;
              margin-top: -40%;
              .profile{
                padding: 0 5% 10% 5%;
                text-align: center;
                .resume-btn {
                  margin-left: 2%;
                }
              }
          }
        }
        .icon-section, .info-box{
          display: none;
        }
      }
    }
// Medium devices (tablets, 768px and up)
@media (min-width: 768px) {
  .home {
    width: 100%;
    .content-area{
      .img-container{
        padding: 25% 2% 0 2%;
        .user-img {

        }
      }
    .profile-section {
      width: 60%;
      float: right;
      }
    }
  }
}
// Large devices (desktops, 992px and up)
@media (min-width: 992px) {
    .home {
      width: 100%;

      }
    }
