  .dropbtn {
  background-color: #0e4f91;
  color: white;
  padding: 20px;
  font-size: 16px;
  border: none;
  cursor: pointer;
}

.dropdown {
  position: relative;
  display: inline-block;
}

.dropdown-content {
  display: none;
  position: absolute;
  right: 0;
  background-color: #f9f9f9;
  min-width: 160px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  z-index: 1;
}

.dropdown-content a {
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
}

.dropdown-content a:hover {
  background-color: #42f4d7;
}
.dropdown:hover .dropdown-content {
  display: block;
}
.dropdown:hover .dropbtn {
  background-color: #42f4d7;
}



// border radius genertor to create btn shape
 .primary-btn {
   background:#0e4f91;
   -webkit-border-radius: 30px;
   -moz-border-radius: 30px;
   border-radius: 30px;
   text-align: center;
   color: white;
   padding: 15px 30px;
   display: inline-block;
   text-transform: uppercase;
   letter-spacing: 3px;
   text-decoration: none;
   transition: all 0.3s ease-in-out;
   &:hover {
     background-color: #42f4d7;
     color: #0e4f91;
     font-weight: bold;
   }
 }

 .resume-btn {
   border: 4px solid #0e4f91;
   -webkit-border-radius: 30px;
   -moz-border-radius: 30px;
   border-radius: 30px;
   text-align: center;
   color: #0e4f91;
   padding: 12px 27px;
   display: inline-block;
   text-transform: uppercase;
   letter-spacing: 3px;
   margin-left: 15px;
   font-weight: bold;
   text-decoration: none;
   transition: all 0.3s ease-in-out;
   &:hover {
     border: 0;
     background-color: #42f4d7;
     color: #0e4f91;
     font-weight: bold;
     padding: 15px 30px;
   }
 }


.scroll {
  height: 100vh;
  overflow-y: scroll;
  overflow-x: hidden;
  padding: 56px; //(left side padding)
}

